import React from "react";
import { Button } from "antd";
import "../../assets/css/index.css";

const StyleView = () => {
  return (
    <>
      <h1>Css Testboard!</h1>
        <hr />
        <Button type="primary" style={{ marginLeft: 8 }}>
            Primary Button
        </Button>
    </>
  );
};

export default StyleView;
